import { FC } from "react";
import Header from "../Header";
import Menu from "../Menu";
import ProductsList from "./ProductsList";

type ProductsProps = {};

const Product: FC<ProductsProps> = () => {
  return (
    <div>
      <Header />
      <div className="flex">
        <div className="w-[15%]">
          <Menu />
        </div>
        <div className="w-[85%]">
          <ProductsList />
        </div>
      </div>
    </div>
  );
};

export default Product;
